import './App.css';
import { ToDoList } from './ToDo';

function App() {
  return (
    <div className="App">

     <div className="container">
      <h1>BE THE BOSS of your day</h1>
     </div>
     <div className="container">
      <h2>TO DO LIST</h2>
     </div>
     <ToDoList/>
    </div>

  );
}

export default App;
